    private let gridSize = 5
    private let dotSize: CGFloat = 10
    private let gridWidth: CGFloat = 200

    // Duress pattern: reverse diagonal
    private let highlightedDots: [(Int, Int)] = [(0, 4), (1, 3), (2, 2), (3, 1), (4, 0)]

