        VStack(spacing: 0) {
            Text("Give us a rating")
                .font(.title2)
                .fontWeight(.bold)
                .multilineTextAlignment(.center)
                .padding(.top, 20)

            Spacer()

            // Stat section  centered vertically
            VStack(spacing: 0) {
                Text("1M+ vaults\ncreated")
                    .font(.system(size: 38, weight: .heavy))
                    .multilineTextAlignment(.center)
                    .lineSpacing(2)

                // Overlapping avatars
                HStack(spacing: -10) {
                    ForEach(ReviewData.allReviews.indices, id: \.self) { index in
                        ReviewAvatar(url: ReviewData.allReviews[index].avatarURL, size: 44)
                            .overlay(
                                Circle()
                                    .stroke(Color.vaultBackground, lineWidth: 2.5)
                            )
                    }
                }
                .padding(.top, 14)
                .padding(.bottom, 6)

                Text("by people like you")
                    .font(.subheadline)
                    .foregroundStyle(.vaultSecondaryText)
            }

            Spacer()

            // Reviews carousel
            VStack(spacing: 14) {
                ReviewCarousel()

                VStack(spacing: 12) {
                    Button(action: {
                        // Show native iOS rating dialog on this screen
                        // Note: requestReview() only works in App Store builds.
                        // In TestFlight, this button has no effect (expected behavior).
                        requestReview()
                        hasRequestedReview = true
                    }) {
                        Text("Continue")
                            .font(.headline)
                            .frame(maxWidth: .infinity)
                            .padding()
                    }
                    .vaultProminentButtonStyle()
                    .accessibilityIdentifier("rating_continue")

                    Button(action: {
                        onContinue()
                    }) {
                        Text("No, thank you")
